import React from "react";
import "../Principal.css";

export default function Principal() {
  const funcionarios = [
    "Funcionario 1",
    "Funcionario 2",
    "Funcionario 3",
    "Funcionario 4",
    "Funcionario 5",
    "Funcionario 6",
    "Funcionario 7",
    "Funcionario 8",
  ];

  return (
    <div className="dashboard-container">
      {/* Banner */}
      <div className="banner">
        <div
          className="logo"
          style={{ backgroundImage: "url('/image.png')" }}
        ></div>
        <div className="portal-title">Portal de Medicamentos ELEAM</div>
      </div>

      {/* Personal de turno */}
      <h2 className="subtitulo">Personal de turno:</h2>

      {/* Grid de funcionarios */}
      <div className="grid-funcionarios">
        {funcionarios.map((nombre, i) => (
          <div key={i} className="funcionario-card">
            <img src="/funcionario.png" alt={nombre} className="foto-funcionario" />
            <p>{nombre}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
